// Extract data from the input string
const input = $input.first().json.message.text; // Replace "PreviousNode" with your data source node name

// Parse the key-value pairs
const result = {};
input.split('\n').forEach(line => {
  const [key, ...valueParts] = line.split('=');
  if (key && valueParts.length) {
    const value = valueParts.join('=').trim();
    result[key.trim()] = value;
  }
});

// Format into the required JSON structure
const output = {
  WorkflowID: result.WorkflowID || "enter name WorkflowID here",
  SessionID: result.SessionID || "enter SessionID here",
  Token: result.Token || "enter Token here"
};

return [{
  json: output
}];

const raw = $('Basic LLM Chain1').first().json.text;

